Naran piiri Naran piiri (ransk. Cercle de Nara) on paikallishallintoalue Malin Koulikoron alueella. Sen pinta-ala on 30 000 neliökilometriä.[1] Asukkaita on 243 000 henkeä (vuonna 2009)[2]. Naran piiri rajoittuu pohjoisessa Mauritaniaan, idässä Ségoun alueen Nionon piiriin, etelässä Koulikoron alueen Banamban ja Kolokanin piireihin sekä lännessä Kayesin alueen Diéman ja Nioron piireihin. Seutu kuuluu Sahelin vyöhykkeeseen.[1] Piiriin kuuluu 11 maalaiskuntaa: Allahina, Dabo, Dilly, Dogofry, Fallo
..........
] Naran kautta kulkee etelästä Mauritaniaan johtava maantie. Seudun pääelinkeinot ovat maanviljely ja karjanhoito. Tärkeimmät viljelykasvit ovat viljan ohella lehmänpapu ja maapähkinä. Kotieläimiä ovat naudat, lampaat, vuohet, aasit, hevoset, siipikarja sekä vähäisessä määrin kamelit. Lisäksi harjoitetaan kalastusta, keräilyä, käsityöammatteja ja kaupankäyntiä.[1] Lähteet[muokkaa | muokkaa wikitekstiä] - ↑ a b c d Synthèse des Plans de Sécurité Alimentaire des Communes du Cercle Nara 2007–2011 2
